NOTE: All the FLACs are ripped from Dirtyphonics' YouTube videos using FFmpeg.  All the MP3s are taken from Dirtyphonics' SoundCloud.  The FLACs and the MP3s may sound different, such as the outro of Tarantino, and because of that, the short versions (cut) are omitted.  No name changes or tagging has been made to the files.
